import React from 'react';
import { Container } from 'react-bootstrap';
import MyContainer from './StyledContainer';

function LabelInfo(props) {
    return (
       <MyContainer>
           <p>{props.label}</p>
            <p>{props.info}</p>
       </MyContainer>
    )
}

export default LabelInfo;
